trailingComments.value:
*
 * 调起客户端日历控件
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>}
 *
 * @example
 * const params = {
 *  format: 'yyyy-MM',
 *   minDate: '2017-11',
 *   maxDate: '2029-09',
 * };
 * libSQ.exec('show-calendar', {
 *   params,
 * }).catch((err) => {
 *   alert(`[show-calendar][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

